(window.webpackJsonp=window.webpackJsonp||[]).push([[2],{298:function(module,exports){eval('\nmodule.exports = { \n      attributes: {"title":"Programaci√≥n orientada a objetos en C","year":2020,"month":7,"day":2,"hour":"00:25","excerpt":"¬øQu√©?, ¬øprogramaci√≥n orientada a objetos en C?, ¬øes esto posible?, la respuesta es ¬°s√≠, si es posible!, y no es tan complicado como suena, pero requiere de trabajo manual üí™, entonces, repasemos lo que es la programaci√≥n orientada a objetos","picture":"/images/blog/oop_c/header.png"},\n    \n      html: "<p>El fin de este art√≠culo es informativo, probablemente <em>no</em> deber√≠as hacer esto, es tardado y en\\nC es mejor hacer las cosas de otra forma</p>\\n<p>¬øQu√©?, ¬øprogramaci√≥n orientada a objetos en C?, ¬øes esto posible?, la respuesta es ¬°s√≠, si es posible!, y no es tan complicado como suena, pero requiere de trabajo manual üí™, entonces, repasemos lo que es la programaci√≥n orientada a objetos</p>\\n<blockquote>\\n<p>Es un paradigma de programaci√≥n basado en el concepto de &quot;objetos&quot;, que contienen datos en la forma de campos (conocidos como atributos o propiedades) y c√≥digo\\nen la forma de procedimientos (llamados m√©todos)</p>\\n</blockquote>\\n<p style=\\"font-size: 0.7em; text-align: right\\">Tomado de <a href=\\"https://en.wikipedia.org/wiki/Object-oriented_programming#cite_note-1\\">Wikipedia</a></p>\\n<p>Ok, pero ¬øc√≥mo uso la OOP en C?</p>\\n<p>Antes de empezar, hay muchas formas de hacer esto, en general todas comparten ciertas similitudes, por lo que esta solo es una forma de hacerlo</p>\\n<p>Entonces, ¬°comencemos!</p>\\n<h1 id=\\"clases\\"><a id=\\"user-content-clases\\" class=\\"anchor\\" href=\\"#clases\\" aria-hidden=\\"true\\"><svg aria-hidden=\\"true\\" class=\\"octicon octicon-link\\" height=\\"16\\" version=\\"1.1\\" viewbox=\\"0 0 16 16\\" width=\\"16\\"><path d=\\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\\"></path></svg></a>Clases</h1>\\n<p>¬øQu√© ser√≠a de un lenguaje orientado a objetos si no tuviera clases?, por eso es lo primero que debemos pensar en implementar.\\nDe hecho, no es dif√≠cil implementar esto.</p>\\n<p>Primero, veamos c√≥mo se crea una clase en C++:</p>\\n<pre class=\\"language-cpp\\"><code class=\\"language-cpp\\"><span class=\\"token keyword\\">class</span> <span class=\\"token class-name\\">Clase</span> <span class=\\"token punctuation\\">[</span><span class=\\"token operator\\">:</span> <span class=\\"token punctuation\\">[</span><span class=\\"token keyword\\">public</span><span class=\\"token operator\\">|</span><span class=\\"token keyword\\">protected</span><span class=\\"token operator\\">|</span><span class=\\"token keyword\\">private</span><span class=\\"token punctuation\\">]</span> Clase1<span class=\\"token punctuation\\">,</span> <span class=\\"token punctuation\\">[</span><span class=\\"token keyword\\">public</span><span class=\\"token operator\\">|</span><span class=\\"token keyword\\">protected</span><span class=\\"token operator\\">|</span><span class=\\"token keyword\\">private</span><span class=\\"token punctuation\\">]</span> Clase2<span class=\\"token punctuation\\">.</span><span class=\\"token punctuation\\">.</span><span class=\\"token punctuation\\">.</span><span class=\\"token punctuation\\">]</span>\\n<span class=\\"token punctuation\\">{</span>\\n<span class=\\"token punctuation\\">[</span><span class=\\"token keyword\\">public</span><span class=\\"token operator\\">|</span><span class=\\"token keyword\\">protected</span><span class=\\"token operator\\">|</span><span class=\\"token keyword\\">private</span><span class=\\"token punctuation\\">]</span>\\n<span class=\\"token punctuation\\">}</span><span class=\\"token punctuation\\">;</span>\\n</code></pre>\\n<blockquote>\\n<p>class y struct en C++ son lo mismo, solo difieren por el tipo de acceso por defecto siendo public en struct y private en class</p>\\n</blockquote>\\n<p>En C solo tenemos las <code>struct</code>, pero con ellas podemos hacer todo, excepto propiedades privadas y protegidas, ¬øo no?, ¬°si podemos tener propiedades privadas!,\\nhay muchas formas de hacer esto, algunas que no son tan privadas (por ejemplo, tener un prefijo para indicar que son privadas) o utilizar una estructura que implemente\\neso y solo pueda ser accedida desde un lugar privado üôÄ.</p>\\n<p>Para esto se requiere de una estructura que sirva para almacenar las variables privadas y que no pueda ser utilizada en el contexto <em>p√∫blico</em>,\\npara ello vamos a recurrir a utilizar una <em>forward declaration</em> de esta estructura.</p>\\n<blockquote>\\n<p><em>Forward declaration</em> se refiere a declarar un identificador (tipo, variable, constante, funci√≥n) a la que todav√≠a no se le ha dado una definici√≥n completa</p>\\n</blockquote>\\n<p>Entonces, imaginemos que nuestra clase se llama <code>MyClass</code>, entonces podr√≠amos llamar a nuestra implementaci√≥n de las variables privadas\\n<code>MyClassPrivate</code>, por lo que quedar√≠a de esta forma:</p>\\n<pre class=\\"language-c\\"><code class=\\"language-c\\"><span class=\\"token comment\\">// .h</span>\\n<span class=\\"token keyword\\">struct</span> <span class=\\"token class-name\\">MyClassPrivate</span><span class=\\"token punctuation\\">;</span>\\n<span class=\\"token keyword\\">typedef</span> <span class=\\"token keyword\\">struct</span> <span class=\\"token class-name\\">MyClass</span>\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token comment\\">// El compilador necesita saber el tama√±o, en este caso el tama√±o de un apuntador</span>\\n    <span class=\\"token comment\\">// Si no es un apuntador, el compilador no sabe el tama√±o y pues no nos dejar√° compilar</span>\\n    <span class=\\"token keyword\\">struct</span> <span class=\\"token class-name\\">MyClassPrivate</span> <span class=\\"token operator\\">*</span>private<span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span><span class=\\"token punctuation\\">;</span>\\n<span class=\\"token comment\\">// .c</span>\\n\\n<span class=\\"token keyword\\">typedef</span> <span class=\\"token keyword\\">struct</span> <span class=\\"token class-name\\">MyClassPrivate</span>\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token keyword\\">int</span> b<span class=\\"token punctuation\\">;</span>\\n    <span class=\\"token keyword\\">int</span> c<span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span> MyClassPrivate<span class=\\"token punctuation\\">;</span>\\n\\n<span class=\\"token comment\\">// obj->private solo puede ser accedido en este archivo* (hay maneras de saltarse esto, pero no las mencionar√© aqu√≠)</span>\\n</code></pre>\\n<h1 id=\\"constructores-y-destructores\\"><a id=\\"user-content-constructores-y-destructores\\" class=\\"anchor\\" href=\\"#constructores-y-destructores\\" aria-hidden=\\"true\\"><svg aria-hidden=\\"true\\" class=\\"octicon octicon-link\\" height=\\"16\\" version=\\"1.1\\" viewbox=\\"0 0 16 16\\" width=\\"16\\"><path d=\\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\\"></path></svg></a>Constructores y destructores</h1>\\n<blockquote>\\n<p>Un constructor es un m√©todo que se encarga de inicializar un objeto de cierta clase.</p>\\n</blockquote>\\n<p>Los constructores son una de las partes m√°s importantes, pues permiten la inicializaci√≥n de los objetos a un estado\\nen el que sea conveniente para el programa, por ejemplo, imaginemos una clase llamada &quot;TcpConnection&quot; y un constructor que tome\\nuna direcci√≥n ip y un puerto para conectarse, aqu√≠ se puede establecer esa parte de inicializar la conexi√≥n a un estado en el\\nque realmente est√© conectado a &quot;ip:puerto&quot;.</p>\\n<p>En C++ contamos con distintos tipos de ctor, todos tienen la tarea de inicializar un objeto de una clase espec√≠fica.</p>\\n<ul>\\n<li><code>Class::Class()</code> -&gt; constructor vac√≠o</li>\\n<li><code>Class:Class(const Class &amp;obj)</code> -&gt; constructor copia</li>\\n<li><code>Class::Class(Class &amp;&amp;obj)</code> -&gt; constructor de movimiento</li>\\n<li><code>Class::Class(params...)</code> -&gt; constructor con par√°metros</li>\\n</ul>\\n<p>Dicho esto, ¬øc√≥mo utilizamos constructores en C?</p>\\n<p>Puesto que en C solo tenemos funciones, tenemos que recurrir a ellas para inicializar nuestras instancias,\\nuna forma de hacer esto es de la siguiente manera:</p>\\n<pre class=\\"language-c\\"><code class=\\"language-c\\"><span class=\\"token keyword\\">typedef</span> <span class=\\"token keyword\\">struct</span> <span class=\\"token class-name\\">Hey</span>\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token keyword\\">int</span> a<span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span> Hey<span class=\\"token punctuation\\">;</span>\\n\\n<span class=\\"token keyword\\">void</span> <span class=\\"token function\\">Hey_ctor</span><span class=\\"token punctuation\\">(</span>Hey <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n\\n<span class=\\"token comment\\">// y para usarla</span>\\nHey hey<span class=\\"token punctuation\\">;</span>\\n<span class=\\"token function\\">Hey_ctor</span><span class=\\"token punctuation\\">(</span><span class=\\"token operator\\">&amp;</span>self<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n</code></pre>\\n<p>Sencillo, ¬øno?, los dem√°s constructores pueden ser implementador de la misma manera, solo basta con mandarle los par√°metros que necesitemos,\\npor ejemplo, un constructor que reciba un int ser√≠a as√≠:</p>\\n<pre class=\\"language-c\\"><code class=\\"language-c\\"><span class=\\"token comment\\">// puesto que en C no existe la sobrecarga de funciones, podemos extender el nombre del ctor con los parametros que reciba</span>\\n<span class=\\"token keyword\\">void</span> <span class=\\"token function\\">Hey_ctor_i</span><span class=\\"token punctuation\\">(</span>Hey <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">,</span> <span class=\\"token keyword\\">int</span> param<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n</code></pre>\\n<p>Oye, ¬øy un destructor? üí•</p>\\n<p>¬°Pues de la misma manera!, implementamos una funci√≥n que se encargue de realizar esta funci√≥n, veamos el siguiente ejemplo:</p>\\n<pre class=\\"language-c\\"><code class=\\"language-c\\"><span class=\\"token keyword\\">void</span> <span class=\\"token function\\">Hey_dtor</span><span class=\\"token punctuation\\">(</span>Hey <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n\\n<span class=\\"token comment\\">// y para usarlo</span>\\nHey hey<span class=\\"token punctuation\\">;</span>\\n<span class=\\"token function\\">Hey_ctor</span><span class=\\"token punctuation\\">(</span><span class=\\"token operator\\">&amp;</span>hey<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n<span class=\\"token comment\\">// usamos el objeto</span>\\n<span class=\\"token function\\">Hey_dtor</span><span class=\\"token punctuation\\">(</span><span class=\\"token operator\\">&amp;</span>hey<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span> <span class=\\"token comment\\">// y llamamos al dtor</span>\\n</code></pre>\\n<p>¬°Veamos un ejemplo donde apliquemos clases, ctors y dtor!</p>\\n<pre class=\\"language-c\\"><code class=\\"language-c\\"><span class=\\"token comment\\">// Class.h</span>\\n<span class=\\"token comment\\">// Forward declare de la estructura para los campos privados</span>\\n<span class=\\"token keyword\\">struct</span> <span class=\\"token class-name\\">MyClassPrivate</span><span class=\\"token punctuation\\">;</span>\\n\\n<span class=\\"token comment\\">// Creamos la clase</span>\\n<span class=\\"token keyword\\">typedef</span> <span class=\\"token keyword\\">struct</span> <span class=\\"token class-name\\">MyClass</span>\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token comment\\">// variables privadas</span>\\n    <span class=\\"token keyword\\">struct</span> <span class=\\"token class-name\\">MyClassPrivate</span> <span class=\\"token operator\\">*</span>private_members<span class=\\"token punctuation\\">;</span>\\n\\n    <span class=\\"token comment\\">// variables publicas</span>\\n    <span class=\\"token keyword\\">int</span> a<span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span> MyClass<span class=\\"token punctuation\\">;</span>\\n\\n<span class=\\"token comment\\">// Ctor</span>\\n<span class=\\"token keyword\\">void</span> <span class=\\"token function\\">MyClass_ctor</span><span class=\\"token punctuation\\">(</span>MyClass <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">,</span> <span class=\\"token keyword\\">int</span> b<span class=\\"token punctuation\\">,</span> <span class=\\"token keyword\\">int</span> c<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n\\n<span class=\\"token comment\\">// M√©todo get_c</span>\\n<span class=\\"token keyword\\">int</span> <span class=\\"token function\\">MyClass_get_c</span><span class=\\"token punctuation\\">(</span>MyClass <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n\\n<span class=\\"token comment\\">// dtor</span>\\n<span class=\\"token keyword\\">void</span> <span class=\\"token function\\">MyClass_dtor</span><span class=\\"token punctuation\\">(</span>MyClass <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n\\n<span class=\\"token comment\\">// Class.c</span>\\n<span class=\\"token macro property\\">#<span class=\\"token directive property\\">include</span> <span class=\\"token string property\\">\\"class.H\\"</span></span>\\n<span class=\\"token macro property\\">#<span class=\\"token directive property\\">include</span> <span class=\\"token string property\\">&lt;stdlib.h></span></span>\\n\\n<span class=\\"token comment\\">// Definimos la estructura de la que anteriormente hicimos un forward declaration</span>\\n<span class=\\"token keyword\\">typedef</span> <span class=\\"token keyword\\">struct</span> <span class=\\"token class-name\\">MyClassPrivate</span>\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token keyword\\">int</span> b<span class=\\"token punctuation\\">;</span> <span class=\\"token comment\\">// esta variable es privada :D</span>\\n    <span class=\\"token keyword\\">int</span> c<span class=\\"token punctuation\\">;</span> <span class=\\"token comment\\">// esta tambi√©n</span>\\n<span class=\\"token punctuation\\">}</span> MyClassPrivate<span class=\\"token punctuation\\">;</span>\\n\\n<span class=\\"token comment\\">// Implementamos el ctor</span>\\n<span class=\\"token keyword\\">void</span> <span class=\\"token function\\">MyClass_ctor</span><span class=\\"token punctuation\\">(</span>MyClass <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">,</span> <span class=\\"token keyword\\">int</span> b<span class=\\"token punctuation\\">,</span> <span class=\\"token keyword\\">int</span> c<span class=\\"token punctuation\\">)</span>\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token comment\\">// Inicializamos las variables</span>\\n    self<span class=\\"token operator\\">-></span>a <span class=\\"token operator\\">=</span> <span class=\\"token number\\">0</span><span class=\\"token punctuation\\">;</span>\\n    self<span class=\\"token operator\\">-></span>private_members<span class=\\"token operator\\">-></span>b <span class=\\"token operator\\">=</span> b<span class=\\"token punctuation\\">;</span>\\n    self<span class=\\"token operator\\">-></span>private_members<span class=\\"token operator\\">-></span>c <span class=\\"token operator\\">=</span> c<span class=\\"token punctuation\\">;</span>\\n\\n    <span class=\\"token comment\\">// Alojamos memoria</span>\\n    self<span class=\\"token operator\\">-></span>private_members <span class=\\"token operator\\">=</span> <span class=\\"token function\\">malloc</span><span class=\\"token punctuation\\">(</span><span class=\\"token keyword\\">sizeof</span><span class=\\"token punctuation\\">(</span>MyClassPrivate<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span>\\n\\n<span class=\\"token comment\\">// M√©todo get_c</span>\\n<span class=\\"token keyword\\">int</span> <span class=\\"token function\\">MyClass_get_c</span><span class=\\"token punctuation\\">(</span>MyClass <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">)</span>\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token keyword\\">return</span> self<span class=\\"token operator\\">-></span>private_members<span class=\\"token operator\\">-></span>c<span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span>\\n\\n<span class=\\"token comment\\">// Dtor</span>\\n<span class=\\"token keyword\\">void</span> <span class=\\"token function\\">MyClass_dtor</span><span class=\\"token punctuation\\">(</span>MyClass <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">)</span>\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token comment\\">// limpiamos los recursos que haya utilizado MyClass</span>\\n    <span class=\\"token function\\">free</span><span class=\\"token punctuation\\">(</span>self<span class=\\"token operator\\">-></span>private_members<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span>\\n<span class=\\"token comment\\">// main.c</span>\\n<span class=\\"token macro property\\">#<span class=\\"token directive property\\">include</span> <span class=\\"token string property\\">\\"class.h\\"</span></span>\\n<span class=\\"token macro property\\">#<span class=\\"token directive property\\">include</span> <span class=\\"token string property\\">&lt;stdio.h></span></span>\\n\\n<span class=\\"token keyword\\">int</span> <span class=\\"token function\\">main</span><span class=\\"token punctuation\\">(</span><span class=\\"token keyword\\">void</span><span class=\\"token punctuation\\">)</span>\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token comment\\">// Creamos una instancia de la clase MyClass e invocamos al ctor</span>\\n    MyClass object<span class=\\"token punctuation\\">;</span>\\n    <span class=\\"token function\\">MyClass_ctor</span><span class=\\"token punctuation\\">(</span><span class=\\"token operator\\">&amp;</span>object<span class=\\"token punctuation\\">,</span> <span class=\\"token number\\">3</span><span class=\\"token punctuation\\">,</span> <span class=\\"token number\\">25</span><span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n\\n    <span class=\\"token keyword\\">int</span> tmp <span class=\\"token operator\\">=</span> object<span class=\\"token punctuation\\">.</span>private_members<span class=\\"token operator\\">-></span>b<span class=\\"token punctuation\\">;</span> <span class=\\"token comment\\">// oops, error, tipo incompleto</span>\\n    <span class=\\"token function\\">printf</span><span class=\\"token punctuation\\">(</span><span class=\\"token string\\">\\"C vale: %d\\"</span><span class=\\"token punctuation\\">,</span> <span class=\\"token function\\">MyClass_get_c</span><span class=\\"token punctuation\\">(</span><span class=\\"token operator\\">&amp;</span>object<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n\\n    <span class=\\"token function\\">MyClass_dtor</span><span class=\\"token punctuation\\">(</span><span class=\\"token operator\\">&amp;</span>object<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span>\\n</code></pre>\\n<p>Como se puede ver, no es tan complicado realizar esto, quiz√° un poco repetitivo, sin embargo, hay una cuesti√≥n, espero que la hayas notado ;).</p>\\n<p>¬°<strong>Malloc</strong> solo para implementar variables privadas! üò±</p>\\n<p>Calma, que se puede implementar de otra forma, podemos tener un buffer local de memoria del tama√±o que necesitemos para\\nlas variables privadas, o confiar y utilizar una convenci√≥n para las variables privadas (personalmente creo que esto √∫ltimo es lo mejor).</p>\\n<h1 id=\\"herencia\\"><a id=\\"user-content-herencia\\" class=\\"anchor\\" href=\\"#herencia\\" aria-hidden=\\"true\\"><svg aria-hidden=\\"true\\" class=\\"octicon octicon-link\\" height=\\"16\\" version=\\"1.1\\" viewbox=\\"0 0 16 16\\" width=\\"16\\"><path d=\\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\\"></path></svg></a>Herencia</h1>\\n<blockquote>\\n<p>Es un mecanismo para permitir que una clase X se base en otra clase Y, estableciendo una relaci√≥n &quot;X es subclase de Y&quot;</p>\\n</blockquote>\\n<blockquote>\\n    <i class=\\"v-icon mdi mdi-alert\\" style=\\"color: yellow; font-size: 2em\\"></i> Opini√≥n \\n   <br>\\n    <p>No soy partidario de abusar de la herencia, pues creo que puede dar lugar a c√≥digo muy complejo y dif√≠cil de mantener</p>\\n</blockquote>\\n<p>La herencia consiste en crear nuevas clases que partan de clases ya existentes, de manera que tienen todas las propiedades y m√©todos de la clase padre; implementar\\nesto en C tampoco supone dificultad alguna, aunque siendo estrictos, lo implementamos utilizando la composici√≥n.</p>\\n<pre class=\\"language-cpp\\"><code class=\\"language-cpp\\"><span class=\\"token keyword\\">struct</span> <span class=\\"token class-name\\">Object</span>\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token keyword\\">int</span> x<span class=\\"token punctuation\\">;</span>\\n    <span class=\\"token keyword\\">int</span> y<span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span><span class=\\"token punctuation\\">;</span>\\n\\n<span class=\\"token keyword\\">struct</span> <span class=\\"token class-name\\">2dBox</span> <span class=\\"token operator\\">:</span> <span class=\\"token keyword\\">public</span> Object\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token keyword\\">int</span> width<span class=\\"token punctuation\\">;</span>\\n    <span class=\\"token keyword\\">int</span> height<span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span><span class=\\"token punctuation\\">;</span>\\n</code></pre>\\n<p>En C esto se traduce en:</p>\\n<pre class=\\"language-c\\"><code class=\\"language-c\\"><span class=\\"token keyword\\">typedef</span> <span class=\\"token keyword\\">struct</span>\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token keyword\\">int</span> x<span class=\\"token punctuation\\">;</span>\\n    <span class=\\"token keyword\\">int</span> y<span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span> Object<span class=\\"token punctuation\\">;</span>\\n\\n<span class=\\"token keyword\\">typedef</span> <span class=\\"token keyword\\">struct</span> <span class=\\"token class-name\\">2dBox</span>\\n<span class=\\"token punctuation\\">{</span>\\n    Object super<span class=\\"token punctuation\\">;</span> <span class=\\"token comment\\">// clase base</span>\\n    <span class=\\"token keyword\\">int</span> width<span class=\\"token punctuation\\">;</span>\\n    <span class=\\"token keyword\\">int</span> height<span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span> <span class=\\"token number\\">2</span>dBox<span class=\\"token punctuation\\">;</span>\\n</code></pre>\\n<p>¬øC√≥mo se ve la estructura <code>2dBox</code> en memoria?, pues de la siguiente manera (sin contar padding, alignment ni tama√±o de los tipos de dato).</p>\\n<p><img src=\\"/images/blog/oop_c/mem_layout.png\\" alt=\\"Layout en memoria\\"></p>\\n<p>Con la imagen anterior podemos observar que las propiedades de la clase Object van antes que cualquier propiedad de la clase 2dBox, bien podr√≠amos ponerla en cualquier orden,\\npero por cuesti√≥n de est√©tica las pondremos al principio.</p>\\n<p>Hasta aqu√≠ todo bien, as√≠ que la herencia se puede resumir de la siguiente manera.</p>\\n<blockquote>\\n<p>Para heredar de otras clases tenemos que recurrir a la composici√≥n</p>\\n</blockquote>\\n<p>A√∫n hay un aspecto que no hemos tocado, ¬°la sobrecarga de m√©todos y los dtor virtuales!</p>\\n<h1 id=\\"polimorfismo\\"><a id=\\"user-content-polimorfismo\\" class=\\"anchor\\" href=\\"#polimorfismo\\" aria-hidden=\\"true\\"><svg aria-hidden=\\"true\\" class=\\"octicon octicon-link\\" height=\\"16\\" version=\\"1.1\\" viewbox=\\"0 0 16 16\\" width=\\"16\\"><path d=\\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\\"></path></svg></a>Polimorfismo</h1>\\n<p>Antes de entrar a esto, voy a explicar que son los apuntadores a funcions, como declarar uno y como usarlos, posteriormente explicar√© lo que es una vtable.</p>\\n<h3 id=\\"apuntadores-a-funciones\\"><a id=\\"user-content-apuntadores-a-funciones\\" class=\\"anchor\\" href=\\"#apuntadores-a-funciones\\" aria-hidden=\\"true\\"><svg aria-hidden=\\"true\\" class=\\"octicon octicon-link\\" height=\\"16\\" version=\\"1.1\\" viewbox=\\"0 0 16 16\\" width=\\"16\\"><path d=\\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\\"></path></svg></a>Apuntadores a funciones</h3>\\n<p>Los apuntadores a funciones (function pointers) son un tipo especial de apuntadores que tienen la caracter√≠stica de apuntar\\na una funci√≥n y para llamar a la funci√≥n a la que apuntan, los usamos como si fuera una funci√≥n.</p>\\n<p>La sintaxis para declarar un apuntador a funci√≥n es la siguiente (lo se, es fea).</p>\\n<pre><code>[tipo de retorno] (*nombre de la variable)(parametros...);\\n</code></pre>\\n<p>Y un uso de estos ser√≠a el siguiente:</p>\\n<pre class=\\"language-c\\"><code class=\\"language-c\\"><span class=\\"token macro property\\">#<span class=\\"token directive property\\">include</span> <span class=\\"token string property\\">&lt;stdio.h></span></span>\\n<span class=\\"token keyword\\">int</span> <span class=\\"token function\\">square</span><span class=\\"token punctuation\\">(</span><span class=\\"token keyword\\">int</span> param<span class=\\"token punctuation\\">)</span>\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token keyword\\">return</span> param <span class=\\"token operator\\">*</span> param<span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span>\\n\\n<span class=\\"token keyword\\">int</span> <span class=\\"token function\\">main</span><span class=\\"token punctuation\\">(</span><span class=\\"token keyword\\">void</span><span class=\\"token punctuation\\">)</span>\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token keyword\\">int</span> <span class=\\"token punctuation\\">(</span><span class=\\"token operator\\">*</span>my_func_ptr<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">(</span><span class=\\"token keyword\\">int</span><span class=\\"token punctuation\\">)</span> <span class=\\"token operator\\">=</span> square<span class=\\"token punctuation\\">;</span> <span class=\\"token comment\\">// lo asignamos a la funci√≥n</span>\\n    <span class=\\"token comment\\">// tambi√©n podemos asignarlo aqu√≠ de la siguiente manera:</span>\\n    <span class=\\"token comment\\">// my_func_ptr = &amp;square;</span>\\n\\n    <span class=\\"token function\\">printf</span><span class=\\"token punctuation\\">(</span><span class=\\"token string\\">\\"%d\\"</span><span class=\\"token punctuation\\">,</span> <span class=\\"token function\\">my_func_ptr</span><span class=\\"token punctuation\\">(</span><span class=\\"token number\\">8</span><span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span>\\n</code></pre>\\n<p>Lo bueno es que podemos utilizar typedefs para hacerlos m√°s bonitos c:</p>\\n<pre class=\\"language-c\\"><code class=\\"language-c\\"><span class=\\"token macro property\\">#<span class=\\"token directive property\\">include</span> <span class=\\"token string property\\">&lt;math.h></span></span>\\n<span class=\\"token keyword\\">typedef</span> <span class=\\"token keyword\\">double</span> <span class=\\"token punctuation\\">(</span><span class=\\"token operator\\">*</span>FuncPtr<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">(</span><span class=\\"token keyword\\">double</span><span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n\\n<span class=\\"token keyword\\">int</span> <span class=\\"token function\\">main</span><span class=\\"token punctuation\\">(</span><span class=\\"token keyword\\">void</span><span class=\\"token punctuation\\">)</span>\\n<span class=\\"token punctuation\\">{</span>\\n    FuncPtr fptr <span class=\\"token operator\\">=</span> sin<span class=\\"token punctuation\\">;</span> <span class=\\"token comment\\">// Ya no esta feo :D</span>\\n<span class=\\"token punctuation\\">}</span>\\n</code></pre>\\n<p>Los apuntadores a funciones son muy √∫tiles cuando se desean implementar callbacks o personalizar el comportamiento de una funci√≥n (por ejemplo, <a href=\\"https://en.cppreference.com/w/c/algorithm/qsort\\">qsort</a>).</p>\\n<h3 id=\\"virtual-method-table\\"><a id=\\"user-content-virtual-method-table\\" class=\\"anchor\\" href=\\"#virtual-method-table\\" aria-hidden=\\"true\\"><svg aria-hidden=\\"true\\" class=\\"octicon octicon-link\\" height=\\"16\\" version=\\"1.1\\" viewbox=\\"0 0 16 16\\" width=\\"16\\"><path d=\\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\\"></path></svg></a>Virtual method table</h3>\\n<p>Tambi√©n llamada vtable, es una forma de permitir las funciones virtuales (<em>dynamic dispatch</em>), es muy utilizada en muchos lenguajes,\\nde manera sencilla, consiste en una tabla que contiene apuntadores a los m√©todos que se deben llamar para determinada instancia, de esta manera\\nse sabe cu√°l funci√≥n virtual llamar.</p>\\n<p>Es importante mencionar que una vtable <em>es la misma</em> para objetos del mismo tipo, por lo que se puede compartir entre todas las instancias de determinada clase.</p>\\n<p>Un ejemplo de vtable para la siguiente clase (C++):</p>\\n<pre class=\\"language-cpp\\"><code class=\\"language-cpp\\">\\n<span class=\\"token keyword\\">class</span> <span class=\\"token class-name\\">Hey</span>\\n<span class=\\"token punctuation\\">{</span>\\n<span class=\\"token keyword\\">public</span><span class=\\"token operator\\">:</span>\\n    <span class=\\"token keyword\\">virtual</span> <span class=\\"token operator\\">~</span><span class=\\"token function\\">Hey</span><span class=\\"token punctuation\\">(</span><span class=\\"token punctuation\\">)</span> <span class=\\"token operator\\">=</span> <span class=\\"token keyword\\">default</span><span class=\\"token punctuation\\">;</span>\\n\\n    <span class=\\"token keyword\\">virtual</span> <span class=\\"token keyword\\">void</span> <span class=\\"token function\\">foo</span><span class=\\"token punctuation\\">(</span><span class=\\"token punctuation\\">)</span> <span class=\\"token operator\\">=</span> <span class=\\"token number\\">0</span><span class=\\"token punctuation\\">;</span>\\n\\n    <span class=\\"token keyword\\">virtual</span> <span class=\\"token keyword\\">void</span> <span class=\\"token function\\">hey</span><span class=\\"token punctuation\\">(</span><span class=\\"token punctuation\\">)</span> <span class=\\"token operator\\">=</span> <span class=\\"token number\\">0</span><span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span><span class=\\"token punctuation\\">;</span>\\n\\n</code></pre>\\n<div style=\\"overflow-x: auto;\\">\\n|M√©todo             |Funci√≥n que realiza ese proceso|\\n|-------------------|-------------------------------|\\n|Hey_dtor           |0x123EDFAA                     |\\n|Hey_foo            |0x00000000                     |\\n|Hey_hey            |0x00000000                     |\\n</dive>\\nNota: la funci√≥n es la direcci√≥n de la funci√≥n que realizar√° ese proceso, puesto que no tienen implementaci√≥n (a excepci√≥n del dtor) entonces no deben apuntar a una direcci√≥n v√°lida.\\n<p>Ahora veamos a la siguiente clase</p>\\n<pre class=\\"language-cpp\\"><code class=\\"language-cpp\\"><span class=\\"token keyword\\">class</span> <span class=\\"token class-name\\">Foo</span> <span class=\\"token operator\\">:</span> <span class=\\"token keyword\\">public</span> Hey\\n<span class=\\"token punctuation\\">{</span>\\n<span class=\\"token keyword\\">public</span><span class=\\"token operator\\">:</span>\\n    <span class=\\"token keyword\\">virtual</span> <span class=\\"token operator\\">~</span><span class=\\"token function\\">Foo</span><span class=\\"token punctuation\\">(</span><span class=\\"token punctuation\\">)</span> <span class=\\"token operator\\">=</span> <span class=\\"token keyword\\">default</span><span class=\\"token punctuation\\">;</span>\\n    <span class=\\"token keyword\\">void</span> <span class=\\"token function\\">foo</span><span class=\\"token punctuation\\">(</span><span class=\\"token punctuation\\">)</span> override<span class=\\"token punctuation\\">{</span><span class=\\"token punctuation\\">}</span>\\n    <span class=\\"token keyword\\">void</span> <span class=\\"token function\\">hey</span><span class=\\"token punctuation\\">(</span><span class=\\"token punctuation\\">)</span> override<span class=\\"token punctuation\\">{</span><span class=\\"token punctuation\\">}</span>\\n<span class=\\"token punctuation\\">}</span><span class=\\"token punctuation\\">;</span>\\n</code></pre>\\n<p>Su vtable ser√≠a la siguiente (direcciones de memoria solo para demostraci√≥n, no reflejan direcciones reales):</p>\\n<table>\\n<thead>\\n<tr>\\n<th>M√©todo</th>\\n<th>Funci√≥n que realiza ese proceso</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>Foo_dtor</td>\\n<td>0x123EDFAA</td>\\n</tr>\\n<tr>\\n<td>Foo_foo</td>\\n<td>0xAFE23400</td>\\n</tr>\\n<tr>\\n<td>Foo_hey</td>\\n<td>0xFF23400E</td>\\n</tr>\\n</tbody>\\n</table>\\n<p>Puesto que esta clase ya implementa todos los m√©todos, entonces ya apuntan a direcciones v√°lidas (que sean funciones).</p>\\n<p>Va va, pero ¬øc√≥mo implemento <strong>esto</strong> en C?</p>\\n<p>¬øRecuerdas lo de apuntadores a funciones?, pues los vamos a utilizar.</p>\\n<p>Introduciremos una estructura que cumpla con ese proposito:</p>\\n<pre class=\\"language-c\\"><code class=\\"language-c\\"><span class=\\"token keyword\\">typedef</span> <span class=\\"token keyword\\">struct</span> <span class=\\"token class-name\\">Hey_Vtable</span>\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token keyword\\">void</span> <span class=\\"token punctuation\\">(</span><span class=\\"token operator\\">*</span>Class_dtor<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">(</span>Hey <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n    <span class=\\"token keyword\\">void</span> <span class=\\"token punctuation\\">(</span><span class=\\"token operator\\">*</span>Hey_foo<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">(</span>Hey <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n    <span class=\\"token keyword\\">void</span> <span class=\\"token punctuation\\">(</span><span class=\\"token operator\\">*</span>Hey_hey<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">(</span>Hey <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span> Hey_Vtable<span class=\\"token punctuation\\">;</span>\\n\\n<span class=\\"token keyword\\">typedef</span> <span class=\\"token keyword\\">struct</span> <span class=\\"token class-name\\">Hey</span>\\n<span class=\\"token punctuation\\">{</span>\\n    Hey_Vtable <span class=\\"token operator\\">*</span>vtable<span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span> Hey<span class=\\"token punctuation\\">;</span>\\n</code></pre>\\n<p>¬øDebemos implementar una estructura similar para Foo?, no, <strong>a menos</strong> que esta clase tenga m√°s funciones virtuales, o utilizar <a href=\\"https://en.wikipedia.org/wiki/Type_punning\\"><em>type punning</em></a>.</p>\\n<pre class=\\"language-c\\"><code class=\\"language-c\\">\\n<span class=\\"token keyword\\">void</span> <span class=\\"token function\\">Hey_dtor</span><span class=\\"token punctuation\\">(</span>Hey <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">)</span>\\n<span class=\\"token punctuation\\">{</span>\\n<span class=\\"token punctuation\\">}</span>\\n\\n<span class=\\"token keyword\\">void</span> <span class=\\"token function\\">Hey_ctor</span><span class=\\"token punctuation\\">(</span>Hey <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">)</span>\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token keyword\\">static</span> Hey_Vtable <span class=\\"token keyword\\">const</span> vtbl <span class=\\"token operator\\">=</span> <span class=\\"token punctuation\\">{</span>\\n        Hey_dtor<span class=\\"token punctuation\\">,</span> <span class=\\"token comment\\">// destructor</span>\\n        <span class=\\"token constant\\">NULL</span><span class=\\"token punctuation\\">,</span> <span class=\\"token comment\\">// foo</span>\\n        <span class=\\"token constant\\">NULL</span> <span class=\\"token comment\\">// hey</span>\\n    <span class=\\"token punctuation\\">}</span><span class=\\"token punctuation\\">;</span>\\n    self<span class=\\"token operator\\">-></span>vtable <span class=\\"token operator\\">=</span> vtbl<span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span>\\n</code></pre>\\n<p>¬°Genial!, ya podemos invocar al dtor de la siguiente manera: <code>hey.vtable-&gt;Class_dtor(&amp;hey)</code>.</p>\\n<p>Ahora, realicemos la implementaci√≥n para Foo:</p>\\n<pre class=\\"language-c\\"><code class=\\"language-c\\"><span class=\\"token keyword\\">typedef</span> <span class=\\"token keyword\\">struct</span> <span class=\\"token class-name\\">Foo</span>\\n<span class=\\"token punctuation\\">{</span>\\n    Hey base<span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span> Foo<span class=\\"token punctuation\\">;</span>\\n\\n<span class=\\"token keyword\\">void</span> <span class=\\"token function\\">Foo_dtor</span><span class=\\"token punctuation\\">(</span>Foo <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">)</span>\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token function\\">Hey_dtor</span><span class=\\"token punctuation\\">(</span>self<span class=\\"token operator\\">-></span>base<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span>\\n\\n<span class=\\"token keyword\\">void</span> <span class=\\"token function\\">Foo_foo</span><span class=\\"token punctuation\\">(</span>Foo <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">)</span> <span class=\\"token punctuation\\">{</span><span class=\\"token punctuation\\">}</span>\\n\\n<span class=\\"token keyword\\">void</span> <span class=\\"token function\\">Foo_hey</span><span class=\\"token punctuation\\">(</span>Foo <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">)</span> <span class=\\"token punctuation\\">{</span><span class=\\"token punctuation\\">}</span>\\n\\n<span class=\\"token keyword\\">void</span> <span class=\\"token function\\">Foo_ctor</span><span class=\\"token punctuation\\">(</span>Foo <span class=\\"token operator\\">*</span>self<span class=\\"token punctuation\\">)</span>\\n<span class=\\"token punctuation\\">{</span>\\n    <span class=\\"token function\\">Hey_ctor</span><span class=\\"token punctuation\\">(</span><span class=\\"token operator\\">&amp;</span>self<span class=\\"token operator\\">-></span>super<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n    <span class=\\"token keyword\\">static</span> Hey_Vtable <span class=\\"token keyword\\">const</span> vtbl <span class=\\"token operator\\">=</span> <span class=\\"token punctuation\\">{</span>\\n        Foo_dtor<span class=\\"token punctuation\\">,</span> <span class=\\"token comment\\">// destructor</span>\\n        Foo_foo<span class=\\"token punctuation\\">,</span> <span class=\\"token comment\\">// foo</span>\\n        Foo_hey <span class=\\"token comment\\">// hey</span>\\n    <span class=\\"token punctuation\\">}</span><span class=\\"token punctuation\\">;</span>\\n    self<span class=\\"token operator\\">-></span>base<span class=\\"token operator\\">-></span>vtable <span class=\\"token operator\\">=</span> vtbl<span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span>\\n</code></pre>\\n<p>Y para llamar cualquier m√©todo lo hacemos de la misma manera que con el dtor.</p>\\n<p>Hay una cosa que no hemos discutido: el <em>casting</em> de clases hijas a padres y de padres a hijas, a continuaci√≥n, est√°n las opciones para hacerlo.</p>\\n<h3 id=\\"hija-a-padre\\"><a id=\\"user-content-hija-a-padre\\" class=\\"anchor\\" href=\\"#hija-a-padre\\" aria-hidden=\\"true\\"><svg aria-hidden=\\"true\\" class=\\"octicon octicon-link\\" height=\\"16\\" version=\\"1.1\\" viewbox=\\"0 0 16 16\\" width=\\"16\\"><path d=\\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\\"></path></svg></a>Hija a padre</h3>\\n<table>\\n<thead>\\n<tr>\\n<th>Tipo</th>\\n<th>Implementaci√≥n</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>Herencia simple, sin interfaces</td>\\n<td>Utilizar <code>super</code></td>\\n</tr>\\n<tr>\\n<td>Herencia multiple o con interfaces</td>\\n<td>Se implementan las interfaces como campos, se devuelve la interfaz a la que se necesite hacer casting</td>\\n</tr>\\n</tbody>\\n</table>\\n<h3 id=\\"padre-a-hija\\"><a id=\\"user-content-padre-a-hija\\" class=\\"anchor\\" href=\\"#padre-a-hija\\" aria-hidden=\\"true\\"><svg aria-hidden=\\"true\\" class=\\"octicon octicon-link\\" height=\\"16\\" version=\\"1.1\\" viewbox=\\"0 0 16 16\\" width=\\"16\\"><path d=\\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\\"></path></svg></a>Padre a hija</h3>\\n<blockquote>\\n<p>Se recomienda tener un campo donde verifiques la clase a la que pertenece el objeto\\ny verifiques si el casting es v√°lido en tiempo de ejecuci√≥n</p>\\n</blockquote>\\n<table>\\n<thead>\\n<tr>\\n<th>Tipo</th>\\n<th>Implementaci√≥n</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>Herencia simple, sin interfaces</td>\\n<td>Hacer casting de <code>super</code> a un objeto del tipo de la clase hija</td>\\n</tr>\\n</tbody>\\n</table>\\n<p>Para herencia multiple o multiples interfaces se necesita saber el layout em memoria del objeto en cuesti√≥n,\\npor ejemplo, si <code>super</code> tiene un offset de 0x00 en la clase hija, entonces basta\\ncon un casting, por el contrario, si el offset es diferente de 0x00, tenemos que\\nmovernos al principio y aqu√≠ ya hacer casting (esto es peligroso, se utiliza\\naritm√©tica de apuntadores), por ejemplo, imaginemos esto:</p>\\n<blockquote>\\n    <i class=\\"v-icon mdi mdi-alert\\" style=\\"color: yellow; font-size: 2em\\"></i> Esto es Undefined Behavior\\n    <br>\\n</blockquote>\\n<pre class=\\"language-c\\"><code class=\\"language-c\\"><span class=\\"token keyword\\">typedef</span> <span class=\\"token keyword\\">struct</span> <span class=\\"token class-name\\">Child</span>\\n<span class=\\"token punctuation\\">{</span>\\n    Super1 super1<span class=\\"token punctuation\\">;</span>\\n    Super2 super2<span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span>Child<span class=\\"token punctuation\\">;</span>\\n\\n<span class=\\"token keyword\\">void</span> <span class=\\"token function\\">f</span><span class=\\"token punctuation\\">(</span><span class=\\"token punctuation\\">)</span>\\n<span class=\\"token punctuation\\">{</span>\\n    Child c<span class=\\"token punctuation\\">;</span>\\n    Super1 <span class=\\"token operator\\">*</span>s1 <span class=\\"token operator\\">=</span> <span class=\\"token punctuation\\">(</span>Super1<span class=\\"token operator\\">*</span><span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">(</span><span class=\\"token operator\\">&amp;</span>c<span class=\\"token punctuation\\">.</span>super1<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n    Super2 <span class=\\"token operator\\">*</span>s2 <span class=\\"token operator\\">=</span> <span class=\\"token punctuation\\">(</span>Super2<span class=\\"token operator\\">*</span><span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">(</span><span class=\\"token operator\\">&amp;</span>c<span class=\\"token punctuation\\">.</span>super2<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n    <span class=\\"token comment\\">// Vamos a regresarnos</span>\\n    Child <span class=\\"token operator\\">*</span>c1 <span class=\\"token operator\\">=</span> <span class=\\"token punctuation\\">(</span>Child<span class=\\"token operator\\">*</span><span class=\\"token punctuation\\">)</span>s1<span class=\\"token punctuation\\">;</span>\\n    <span class=\\"token keyword\\">unsigned</span> <span class=\\"token keyword\\">char</span> <span class=\\"token operator\\">*</span>temp <span class=\\"token operator\\">=</span> <span class=\\"token punctuation\\">(</span><span class=\\"token keyword\\">void</span><span class=\\"token operator\\">*</span><span class=\\"token punctuation\\">)</span>s2<span class=\\"token punctuation\\">;</span>\\n    Child <span class=\\"token operator\\">*</span>c2 <span class=\\"token operator\\">=</span> <span class=\\"token punctuation\\">(</span>Child<span class=\\"token operator\\">*</span><span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">(</span>s2 <span class=\\"token operator\\">-</span> <span class=\\"token keyword\\">sizeof</span><span class=\\"token punctuation\\">(</span>Super1<span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span> <span class=\\"token comment\\">// retrecedemos sizeof Super1 espacios en memoria</span>\\n<span class=\\"token punctuation\\">}</span>\\n</code></pre>\\n<p>Puedes verlo üëâ <a href=\\"https://godbolt.org/z/QQmJGQ\\">aqu√≠</a> üëà</p>\\n<h1 id=\\"conclusiones\\"><a id=\\"user-content-conclusiones\\" class=\\"anchor\\" href=\\"#conclusiones\\" aria-hidden=\\"true\\"><svg aria-hidden=\\"true\\" class=\\"octicon octicon-link\\" height=\\"16\\" version=\\"1.1\\" viewbox=\\"0 0 16 16\\" width=\\"16\\"><path d=\\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\\"></path></svg></a>Conclusiones</h1>\\n<p>Realizar todo este proceso es muy tardado, y, probablemente es mejor que no lo hagas, si por\\nalguna raz√≥n quieres continuar utilizando C pero quieres orientaci√≥n a objetos, checa <a href=\\"https://developer.gnome.org/gobject/stable/\\">GObject</a>, probablemente sea lo que estas buscando.</p>\\n<p>Finalmente, esta no es la √∫nica forma de realizar todo esto, ¬°hay muchas!, en este sentido\\nC es bastante flexible, pues podemos hacer lo que queramos de la manera en que queramos.</p>\\n",\n    \n      meta: {"resourcePath":"/home/runner/work/alan-blog/alan-blog/content/blog/2020-06-24-oop_c.md"},\n     }//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///298\n')}}]);